              CASE WHEN contract.vertical <> 'Food and Nutrition'                                                                                     THEN LTRIM(RTRIM(COALESCE(NULLIF(vwsyscocheck.FinancialReportingSupplierName, 'Unknown'), NULLIF(Contract.FinancialReportingSupplierName, 'Unknown'), NULLIF(Supplier.ReportingSupplierName, 'Unknown'), SalesAndRevenue.SupplierName)))
