                          WHEN supplier.suppliername = 'US Foods, Inc. - Vizient'                                                                            THEN contract.financialreportingsuppliername
                          WHEN contract.sourceentityname = 'Vizient' AND vwsyscocheck.forceid =account.forceid                                               THEN 'Sysco Corporation'
                          WHEN contract.sourceentityname = 'Vizient'                                                                                         THEN 'US Foods, Inc. - Vizient'
